## Approach:
Check if the size of the current array object(`this`) is `zero` or not. If it's `zero` return `-1` otherwise return the `last element` of the current array object.

# Code
```javascript
Array.prototype.last = function() {
    return this.length===0? -1 : this[this.length - 1];
};
```

The above solution works for this problem. But in real world `-1` could be an array element and this prototype function returning `-1` could lead to confusion whether the array is empty or its last element is `-1`. In such cases it is recommended to return `undefined` rather than -1. Also, we should ensure `prototype.last` is not set before setting it other wise it might overwrite the previous custom implementation, if any. Below code takes care of these cases.

```javascript
// Check if the 'last' method already exists to avoid conflicts
if (!Array.prototype.last) {
  Array.prototype.last = function() {
    const length = this.length;
    return length===0? undefined : this[length - 1];
  };
}
```
