We can call the array and its methods by using the 'this' binding.
We can also use the .at() method to return the element at a certain index. Keep in mind that, when using negative numbers, it counts elements starting from the end. Therefore:

```
const arr = [1,2,3]

console.log(arr.at(-1))
// prints 3

console.log(arr[arr.length - 1])
// prints 3
```

All things considered, the one-liner answer is:
```
Array.prototype.last = function() {
    return this.length ? this.at(-1) : -1
};
```

