# Intuition
The intuition behind this solution is to enhance the built-in JavaScript Array object by adding a custom last() method. This method should check the length of the array and return the last element if the array is not empty, or return -1 if the array is empty. This customization allows us to conveniently access the last element of any array using the .last() method.

Approach:

# Approach
I extend the Array.prototype object by defining a new method called last().

Inside the last() method:

I check if the length of the array (accessed with this.length) is greater than 0.
If the length is greater than 0, I return the last element of the array using this[this.length - 1], which accesses the last element.
If the length is 0 (indicating an empty array), I return -1 as required.
By adding this custom method to Array.prototype, I make it available on all arrays, allowing us to call .last() on any array and obtain the desired result.
# Complexity
- Time complexity:
$$O(1)$$

- Space complexity:
