    You have three output cases null, -1, and the last element, brought on by 5 cases: non compliant numbers, null elements, empty arrays, non interger elements

# Approach
First handle the null cases, one can grab the last element and test for null values, and since it returns a null i chose to keep it as a standalone if block. secondly check for numbers within constrants 0-1000. handed this an if with an and statement, if the element is non-compliant, it is a -1. Next i tested for an empty array(this should probably be one the first things i check...) if it was not empty return the last element. anything else return -1;

