```
Array.prototype.last = function() {
    if (this[this.length -1] === null)
    {
        return null;
    }
    if (0 <= this.length && this.length <= 1000) {
        if (this.length === 0 ) {
            return -1;
        } else {
            return this[this.length -1];
        }
    }
    return -1;
};
